# much faster alternate for initial segment of sequence
from sympy import nextprime
def aupton(terms):
    p1, p2, alst = 2, 3, []
    while len(alst) < terms:
        p1, p2, alst = p2, nextprime(p2), alst + [(p1*p2)%10]
    return alst
